import React from "react";
import { NavDropdown} from "react-bootstrap";


const NavBar = (props) => {
    return (
        <div>
                <NavDropdown.Item href={props.id}>{props.name}</NavDropdown.Item>
        </div>
    )
}
export default NavBar;
